import React from 'react';
import { Grid, Divider, List, ListItem, ListItemText } from '@material-ui/core';
import Controls from '../Components/Controls/Controls';

const FormSubmitPage = (props: any) => {
    const { handleSubmit, prevStep, handleInputChange, values, children, ...other } = props;
    const {
        fullName, email, numBlendedLearning, numSchedules,
        numRooms, numSetsSameDay, numPairsDiffDay, numSpecialSets,
    } = values;

    const myPrevious = (e: any) => {
        e.preventDefault();
        prevStep();
    }

    return (
        <Grid container>
            {children}
            <List>
                <ListItem>
                    <ListItemText 
                        primary="Full Name"
                        secondary={fullName.length}
                    />
                </ListItem>
                <ListItem>
                    <ListItemText 
                        primary="Email"
                        secondary={email}
                    />
                </ListItem>
                <ListItem>
                    <ListItemText 
                        primary="Number of students in Blended Learning"
                        secondary={numBlendedLearning}
                    />
                </ListItem>
                <ListItem>
                    <ListItemText 
                        primary="Number of schedules"
                        secondary={numSchedules}
                    />
                </ListItem>
                <ListItem>
                    <ListItemText 
                        primary="Number of classrooms"
                        secondary={numRooms}
                    />
                </ListItem>
                <ListItem>
                    <ListItemText 
                        primary="Number of sets on the same day"
                        secondary={numSetsSameDay}
                    />
                </ListItem>
                <ListItem>
                    <ListItemText 
                        primary="Number of pairs of students on different days"
                        secondary={numPairsDiffDay}
                    />
                </ListItem>
                <ListItem>
                    <ListItemText 
                        primary="Number of special sets"
                        secondary={numSpecialSets}
                    />
                </ListItem>
            </List>
            <Divider />
            <Grid item sm={12}>
                <Controls.MyButton 
                    type="submit" 
                    value="Submit" 
                    text="Submit" 
                    onClick={(e: Event) => handleSubmit(e)}
                />
                <Controls.MyButton
                    text="Back"
                    color="default"
                    onClick={myPrevious}
                />
            </Grid>
        </Grid>
    )
}

export default FormSubmitPage;
